    {
      price: DataTypes.STRING,
      acreage: DataTypes.STRING,
      published: DataTypes.STRING,
      hashtag: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "Attribute",
    }
  );
  return Attribute;
};

